    /**
     * 给定一个字符串，请你找出其中不含有重复字符的 最长子串 的长度
     * @param s
     * @return
     */
    public int lengthOfLongestSubstring(String s) {
        int len = s.length();
        do {
            for (int i = 0; i + len <= s.length(); i++) {
                String str = s.substring(i, i + len);
                if (!judge1(str)){
                    return len;
                }
            }
        } while (--len > 0);

        return 0;
    }

    /**
     * 判断str中是否有重复字符
     * @param str
     * @return
     */
    public boolean judge1(String str){
        if(str == null || str.length()== 0){
            return false;
        }

        /**
         * 对字符串中的前len-1个字符检查是否有重复字符
         */
        char[] chars = str.toCharArray();
        for (int i = 0; i < chars.length - 1; i++) {
            String sub = String.valueOf(chars[i]);
            if (judge(str, sub)) {
                return true;
            }
        }
        return false;
    }

    /**
     * 判断str中是否有重复subStr子串
     * @param str
     * @param subStr
     * @return
     */
    public boolean judge(String str, String subStr){
        if (str == null || str.length() == 0 || subStr == null || subStr.length() == 0) {
            return false;
        }

        int i = str.indexOf(subStr);
        if (i != -1) {
            str = str.substring(i + 1);
            int i1 = str.indexOf(subStr);
            if(i1 > -1){
                return true;
            }
        } else {
            return false;
        }

        return false;
    }

